import { showRenewHistory } from '../actions/actions'
import axios from 'axios'
class GetRequest {
  static async getHistory() {
    return (dispatch) => {
      const data = axios.get('/his')
      return dispatch(showRenewHistory(data))
    }
  }
}

export default GetRequest
